//cross browser soundcheck

var hidden, visibilityChange;
if (typeof document.hidden !== "undefined") {
    hidden = "hidden";
    visibilityChange = "visibilitychange";
} else if (typeof document.mozHidden !== "undefined") {
    hidden = "mozHidden";
    visibilityChange = "mozvisibilitychange";
} else if (typeof document.msHidden !== "undefined") {
    hidden = "msHidden";
    visibilityChange = "msvisibilitychange";
} else if (typeof document.webkitHidden !== "undefined") {
    hidden = "webkitHidden";
    visibilityChange = "webkitvisibilitychange";
}

document.addEventListener(visibilityChange, gameCustomVisibilityChange, false);
function gameCustomVisibilityChange() {
if (document[hidden]==true)
{
gameSoundLoop.pause();
}

if (document[hidden]==false)
{
}

}


var soundEnabled=true;
function soundCheck(){
//document
if (document[hidden]==false)
{
if(soundEnabled==true) gameSoundLoop.play();
if(soundEnabled==true) Howler.volume(1);
}

if (document[hidden]==true)
{
Howler.volume(0);
gameSoundLoop.pause();
}
//mraid
if(typeof mraid !== 'undefined'){
if(mraid.isViewable()==true)
{
if(soundEnabled==true) Howler.volume(1);
}
else {
Howler.volume(0);
gameSoundLoop.pause();
}
}


}
